            <div>
                <Button
                    variant="contained"
                    color="secondary"
                    className={classes.button}
                    startIcon={<DeleteIcon />}
                >
                    DELETAR ANÚNCIO
                </Button>

                <Button
                    variant="contained"
                    color="default"
                    className={classes.button}
                    startIcon={<CloudUploadIcon />}
                >
                    ALTERAR ANÚNCIO
                </Button>

                <Button
                    variant="contained"
                    color="primary"
                    className={classes.button}
                    endIcon={<Icon>send</Icon>}
                >
                    CRIAR ANÚNCIO
                 </Button>
            </div>

        </>

    )

}
